import React from 'react';
import logo from './logo.svg';
import './App.css';
import RenderDungeon from "./pages/DmGamePage";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://webstockreview.net/images/d20-clipart-blank.jpg" className="App-logo" alt="logo" />
        <p>
          Adventure awaits...
        </p>
        <RenderDungeon />
      </header>
    </div>
  );
}

export default App;
